import React from 'react';
import '../styles/Dashboard.css';

const mockItems = [
  { id: 1, name: 'Textbook - Calculus', status: 'Active' },
  { id: 2, name: 'Laptop - Dell Inspiron', status: 'Pending' },
  { id: 3, name: 'Desk Lamp', status: 'Exchanged' }
];

const mockMetrics = {
  totalUsers: 120,
  totalItems: 85,
  totalExchanges: 42,
  ecoPointsAwarded: 5600
};

export default function Dashboard() {
  return (
    <div className="dashboard-container">
      <h1>Admin Dashboard</h1>

      <section className="metrics">
        <h2>Platform Metrics</h2>
        <ul>
          <li><strong>Total Users:</strong> {mockMetrics.totalUsers}</li>
          <li><strong>Total Items Listed:</strong> {mockMetrics.totalItems}</li>
          <li><strong>Total Exchanges:</strong> {mockMetrics.totalExchanges}</li>
          <li><strong>Eco-Points Awarded:</strong> {mockMetrics.ecoPointsAwarded}</li>
        </ul>
      </section>

      <section className="listings">
        <h2>Item Listings</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Item Name</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {mockItems.map(item => (
              <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>
    </div>
  );
}
